import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import axios from "axios";
import "./main.css";

function Header() {
  return (
    <header className="innerHeader">
      <img className="logo" src="images/books-logo.jpg" alt="Company Logo" title="Company Logo" />
      <h1>Misal's BookShop</h1>
      <nav>
        <ul>
          <li><Link to="/" className="active">Home</Link></li>
          <li><Link to="#">About Us</Link></li>
          <li><Link to="#">Contact Us</Link></li>
        </ul>
      </nav>
    </header>
  );
}

function Home() {
  return (
    <div>
      <h1>Welcome to the Bookstore</h1>
      <Link to="/catalog">View Catalog</Link>
    </div>
  );
}

function Catalog() {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/catalog").then((response) => {
      setBooks(response.data);
    });
  }, []);

  return (
    <div className="container">
      <h1>Book Catalog</h1>
      <div className="book-list">
        {books.map((book) => (
          <section key={book.id} className="book">
            <h2>{book.title}</h2>
            <p>{book.description}</p>
            <img src={`images/${book.image}`} alt={book.title} className="bookImage" />
            <Link to="/cart" className="button">Add to Cart</Link>
          </section>
        ))}
      </div>
    </div>
  );
}

function Cart() {
  const [cartItems, setCartItems] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8080/cart").then((response) => {
      setCartItems(response.data);
    });
  }, []);

  return (
    <div>
      <h1>Shopping Cart</h1>
      <ul>
        {cartItems.map((item) => (
          <li key={item.id}>{item.title} - ${item.price}</li>
        ))}
      </ul>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/catalog" element={<Catalog />} />
        <Route path="/cart" element={<Cart />} />
      </Routes>
      <Footer />
    </Router>
  );
}
